import { crawler, Chain, Network, Provider } from '../src/index'
import { ethers } from 'ethers'
import { EthereumService } from '../dist/providers/Ethereum'

test('parse beacon desposit log', async () => {
  const log = {
    transactionIndex: 135,
    blockNumber: 15778942,
    transactionHash: '0xb80345e7f3dd15250b5b5c7018394a42cae9e4f3e044f99076ed3fb964d10a60',
    address: '0x00000000219ab540356cBB839Cbe05303d7705Fa',
    topics: [
      '0x649bbc62d0e31342afea4e5cd82d4049e7e1ee912fc0889aa790803be39038c5'
    ],
    data: '',
    logIndex: 504,
    blockHash: '0x2988845f915927cadf32b8c487e803810450abf8e28adc83a8c1ca183b6e0384'
  }

  const expected = {
      pubkey: '0x81cd4214ba570d937bd7db5f5f135bf710eaa4eed65bb4474861bcff2956ff56ae5f17e38a71dcbb36a576d8e4751108',
      withdrawal_credentials: '0x00664f58c9907ed3a4461ef75afaf70df807b3042cb2acf92a7889cfde2055e9',
      amount: '0x0040597307000000',
      signature: '0x85b8268d08a7360940ce84d5a0d0e65f516e39574a4cab47e116b1fe457ccb3c438e901e1b91cae2224db5bae78079890a90fde9e9308dae9c4f894a3fec8e5a26c154de29c60c8c5ad99df62b4ca89b40423814004a50eec90f502d06fc4345',
      index: '0xe9f7060000000000'
    }
	const service = new EthereumService()
    const got = service.parseLog(log as ethers.providers.Log)
    expect(got).toEqual(expected)
})

test('setup eth', async () => {
	const eth = await crawler({
		chain: Chain.Ethereum,
		network: Network.Mainnet,
		provider: Provider.Alchemy,
		verbose: true,
	})
	expect(eth.head).not.toBe(0)
})

test('setup iotex', async () => {
	const iotex = await crawler({
		chain: Chain.Iotex,
		network: Network.Mainnet,
		provider: Provider.Alchemy,
		verbose: true,
	})
	expect(iotex.head).not.toBe(0)
})

